      body,

        margin: 0;
        width: 100%;
        height: 100%;

        font-synthesis: none;

        background-color: #ffffff;
      }
      @media (prefers-color-scheme: dark) {
        .bg-color {
          background-color: #292f36;
        }
      }
      @keyframes fade-in {
        0% {
          opacity: 0;
        }
        100% {
          opacity: 1;
        }
      }
      .show-after-init {
        visibility: hidden;
        animation: fade-in 1s ease-out;
      }
      .flex {
        display: flex;
      }
      .flex.flex-row {
        flex-direction: row;
      }
      .flex.items-center {
        align-items: center;
      }
      .flex.justify-center {
        justify-content: center;
      }
      .bezel {
        display: inline-block;
        border-width: 2rem;
        border-style: solid;
        border-color: #dfe6eb;
        overflow: hidden;
      }
      @media (prefers-color-scheme: dark) {
        .bezel {
          border-color: #1e2229;
        }
      }
      .bezel-classic {
        background: linear-gradient(
          45deg,
          #000000 45%,
          #2e2e2e 47%,
          #000000 55%
        );
      }
      .rounded-lg {
        border-radius: 0.5rem;
      }
      .rounded-full {
        border-radius: 9999px;
      }
      .ring {
        outline: solid 1px #aeb4b7;
      }
      @media (prefers-color-scheme: dark) {
        .ring {
          outline: solid 1px #46505c;
        }
      }
      canvas {
        animation: fade-in 0.3s linear;
        display: block;
        aspect-ratio: (320 / 480);
      }
      .fit-w {
        width: calc(100dvw - 5rem);
      }
      .fit-h {
        height: calc(100dvh - 5rem);
      }

      function resizeCallback() {
        const canvas = document.getElementById('canvas');
        const container = document.getElementById('screen');
        const dvh = window.innerHeight;
        const dvw = window.innerWidth;
        const bz = Math.min(dvw, dvh) * 0.0375;
        const cw = 320 + bz * 2.5;
        const ch = 480 + bz * 2.5;
        if (dvh < ch) {
          canvas.classList.remove("fit-w");
          canvas.classList.add("fit-h");
        } else if (dvw < cw) {
          canvas.classList.remove("fit-h");
          canvas.classList.add("fit-w");
        }
        if (dvw > cw) {
          canvas.classList.remove("fit-w");
        }
        if (dvh > ch) {
          canvas.classList.remove("fit-h");
        }
        container.style.borderWidth = `${bz}px`;

  Module['monitorRunDependencies']?.(runDependencies);

}

function removeRunDependency(id) {
  runDependencies--;

  Module['monitorRunDependencies']?.(runDependencies);

  if (runDependencies == 0) {
    if (runDependencyWatcher !== null) {
      clearInterval(runDependencyWatcher);
      runDependencyWatcher = null;
    }
    if (dependenciesFulfilled) {
      var callback = dependenciesFulfilled;
      dependenciesFulfilled = null;
      callback(); // can add another dependenciesFulfilled
    }
  }
}

/** @param {string|number=} what */
function abort(what) {
  Module['onAbort']?.(what);

  what = 'Aborted(' + what + ')';
  // TODO(sbc): Should we remove printing and leave it up to whoever
  // catches the exception?
  err(what);

  ABORT = true;
  EXITSTATUS = 1;

  what += '. Build with -sASSERTIONS for more info.';

  // Use a wasm runtime error, because a JS error might be seen as a foreign
  // exception, which means we'd run destructors on it. We need the error to
  // simply make the program stop.
  // FIXME This approach does not work in Wasm EH because it currently does not assume
  // all RuntimeErrors are from traps; it decides whether a RuntimeError is from
  // a trap or not based on a hidden field within the object. So at the moment
  // we don't have a way of throwing a wasm trap from JS. TODO Make a JS API that
  // allows this in the wasm spec.

  // Suppress closure compiler warning here. Closure compiler's builtin extern
  // definition for WebAssembly.RuntimeError claims it takes no arguments even
  // though it can.
  // TODO(https://github.com/google/closure-compiler/pull/3913): Remove if/when upstream closure gets fixed.
  /** @suppress {checkTypes} */
  var e = new WebAssembly.RuntimeError(what);

  // Throw the error whether or not MODULARIZE is set because abort is used
  // in code paths apart from instantiation where an exception is expected
  // to be thrown when abort is called.
  throw e;
}

var wasmBinaryFile;

function getBinarySync(file) {
  if (file == wasmBinaryFile && wasmBinary) {
    return new Uint8Array(wasmBinary);
  }
  var binary = tryParseAsDataURI(file);
  if (binary) {
    return binary;
  }
  if (readBinary) {
    return readBinary(file);
  }
  throw 'both async and sync fetching of the wasm failed';
}

function getBinaryPromise(binaryFile) {

  // Otherwise, getBinarySync should be able to get it synchronously
  return Promise.resolve().then(() => getBinarySync(binaryFile));
}

function instantiateArrayBuffer(binaryFile, imports, receiver) {
  return getBinaryPromise(binaryFile).then((binary) => {
    return WebAssembly.instantiate(binary, imports);
  }).then(receiver, (reason) => {
    err(`failed to asynchronously prepare wasm: ${reason}`);

    abort(reason);
  });
}

function instantiateAsync(binary, binaryFile, imports, callback) {
  return instantiateArrayBuffer(binaryFile, imports, callback);
}

function getWasmImports() {
  // prepare imports
  return {
    'env': wasmImports,
    'wasi_snapshot_preview1': wasmImports,
  }
}

// Create the wasm instance.
// Receives the wasm imports, returns the exports.
function createWasm() {
  var info = getWasmImports();
  // Load the wasm module and create an instance of using native support in the JS engine.
  // handle a generated wasm instance, receiving its exports and
  // performing other necessary setup
  /** @param {WebAssembly.Module=} module*/
  function receiveInstance(instance, module) {
    wasmExports = instance.exports;

    

    wasmMemory = wasmExports['memory'];
    
    updateMemoryViews();

    wasmTable = wasmExports['__indirect_function_table'];
    

    addOnInit(wasmExports['__wasm_call_ctors']);

    removeRunDependency('wasm-instantiate');
